import React from 'react';

const Hero = () => {

  return (
    <>
    <h1>HERO SECTION</h1>
      <style jsx>{`
        .main-header {
          display: flex;
          justify-content: space-between;
          padding: 15px 10px 15px 10px;
          margin-bottom: 20px;
          background-color: #0b334d;
        }

        .menu {
          display: flex;
          justify-content: flex-end;
          width: 280px;
          margin-top: 4px;
          margin-right: 13px;
        }

        .logo-group {
          display: flex;
          text-decoration: none;
          margin-top: 0px;
        }

        .logo-img {
          margin-top: 4px;
          width: 60px;
          height: 35px;
        }

        .logo-type {
          color: white;
          font-size: 1.1rem;
          font-weight: 400;
          margin-top: 12px;
          font-family: sans-serif;
          letter-spacing: 1px;
        }
      `}</style>
    </>
  );
}

export default Hero
